import React from 'react'
import text from './Assets/text.png'
import './content.css';
function Content() {
  return (
    <main className = 'main'>
      <div className='Bg'/>
      <div>
          <img src = {text} alt = "Text" className='Image'/>
        </div>
    </main>
  );
}

export default Content
